<H1><A NAME="lnk4042"></A><SUP></SUP>Linker Tools Warning LNK4042</H1>

<P class=dt><B>object specified more than once; extras ignored</B></P>

<P>The same object file was specified more than once in the LINK or LIB command. The result is the same as if the file were specified only the first time.</P>
